import {BrowserRouter, Switch, Route} from "react-router-dom"

const Router = () =>{
  return(
    <BrowserRouter>
      <Switch>
        <Router path="/" component={App} />
      </Switch>
    </BrowserRouter>
  )
}

export default Router
